import { Route } from 'react-router-dom'
import Welcome from './pages/Welcome';
import Products from './pages/Products';

function App() {
  return (
    <div>
      <header>Nav</header>
<Route path="/welcome">

<Welcome/>
</Route>


<Route path="/products">

<Products/>
</Route>
    </div>
  );
}

export default App;
